import React from "react";
import UserItem from "./UserItem";


import "./UserList.css";
import User from "../pages/User";


const UserList = ({items})=>{
    items.length > 0 ? (
        <ul>
            {items.map(item => <UserItem key={User._id} user={user}/>)}
        </ul>
    ):(
        <div className="center">
            <h2>No user found.</h2>
        </div>
    )
}


export default UserList;
